script: |
  super -f text -I q9902.spq | sort > q9902.out

inputs:
  - name: q9902.spq
    data: |
      SELECT ALL CAST ( col2 AS INTEGER ) AS col2 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN + - col1 / - ( 59 ) - + col1 - - + col2 + - col1 - + + 39 * 68 AND col2;
  - name: tab2

outputs:
  - name: q9902.out
    data: |
